function transfer(address recipient, uint256 amount) public {
    require(recipient != address(0), "Transfer to the zero address");
    require(msg.sender != address(0), "Transfer from the zero address");
    require(amount > 0, "Transfer amount must be greater than zero");
    require(msg.sender == owner, "Only owner can transfer");
    require(recipient == owner, "Recipient must be the owner");

    address sender = msg.sender;

    // Check if sender is allowed to transfer
    require(!transferDelayEnabled, "Only one transfer per block allowed");
    require(block.number > lastTransferBlock[sender], "Only one transfer per block allowed");

    // Update the last transfer block for the sender
    lastTransferBlock[sender] = block.number;

    // Calculate the transfer fee
    uint256 fee = (amount * transferFee) / 100;
    uint256 transferAmount = amount - fee;

    // Ensure the transfer amount is valid
    require(transferAmount > 0, "Transfer amount must be greater than zero after fee");

    // Update balances
    balances[sender] -= amount;
    balances[recipient] += transferAmount;
    balances[address(this)] += fee;

    // Emit transfer events
    emit Transfer(sender, recipient, transferAmount);
    emit Transfer(sender, address(this), fee);
}

